async function API(message)
{
    let requestOptions =
    {
        mode: 'no-cors',
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify({msg: message})
    }

    let response = await fetch('http://localhost:5000/send', requestOptions)
    let data = await response.json()

    return data
}

export default API
